const App = () => {
  const now = new Date(); 
  const a = 10; 
  const b = 20; 
  console.log("Hello from the component")
  return (
    <div>
      <p>Hello world</p>
      <p>Hello world, it is {now.toString()}</p>
      <p>{a} plus {b} is {a+b}</p>
    </div>
  )
}

export default App
